package main

import (
	"fmt"
	"strings"
	"unicode"
)

func main() {
	min := 10000000000
	for c := 'z'; c >= 'a'; c-- {
		upper := unicode.ToUpper(c)
		try := strings.Replace(input, string(c), "", -1)
		try = strings.Replace(try, string(upper), "", -1)
		l := len(react(try))
		if l < min {
			fmt.Printf("%v - %v\n", string(c), l)
			min = l
		}

	}
}

func react(i string) string {
	for {
		swap := false
		for c := 'z'; c >= 'a'; c-- {
			upper := unicode.ToUpper(c)
			newInput := strings.Replace(i, string(c)+string(upper), "", -1)
			newInput = strings.Replace(newInput, string(upper)+string(c), "", -1)
			if newInput != i {
				i = newInput
				swap = true
			}
		}
		if !swap {
			return i
		}
	}
}

